export const FULL_CARD_LIST = Object.keys(CARD).map(Number).map((cardId) => {
  const param = PARAMETER[cardId];
  if (param === undefined) throw Error(`Parameter info of card ${cardId} is missing`);
  return param.map((el, uncap) => ({
    id: cardId,
    uncap,
    ...CARD[cardId]!,
    ...el,
    statSum: el.a + el.s + el.t,
  }));
}).reduce((acc, val) => acc.concat(val), []);
